FieldEntry.Formula:
ARRAY_WHERE(
	ARRAY_DISTINCT(
		ARRAY_CONCAT(
			[Prefix List],
			[New Prefix]
		)
	), $(i, item) 
	$item <> NULL()
)

ARRAY_WHERE(
	ARRAY_DISTINCT(
		ARRAY_CONCAT(
			[Prefix List],
			[Contract Number Prefix] & YEAR(NOW()) & "-"
		)
	), $(i, item) 
	$item <> NULL()
)

ARRAY_WHERE(
	ARRAY_DISTINCT(
		ARRAY_CONCAT(
			[Prefix List],
			[Contract Number Prefix] & FINANCIALYEAR(NOW()) & "-"
		)
	), $(i, item) 
	$item <> NULL()
)

LET $data := [Import Data];

LET $blankRowsFiltered := ARRAY_WHERE(
	$data,
	$(i, row) ARRAY_LENGTH(
		ARRAY_WHERE(
			$row, 
			$(c, cell) NOT(ISBLANK($cell))
		)
	) > 0
);

RETURN $blankRowsFiltered

//check to see if spreadsheet has the correct columns
LET $data := [Import Data];
LET $columns := ARRAY_FIRST($data);

//check to make sure all input columns are not new
LET $currentColumns := DB_GETCOLUMNS([Template Selection]);

LET $check := ARRAY_SELECT(
	$columns,
	$(i,item) IF(
		ISNULL(ARRAY_INDEXOF($currentColumns,$item)),
		$item,
	NULL()
	)
);

LET $diffColumns := ARRAY_WHERE(
	$check,
	$(i,item) NOT(ISNULL($item))
);

LET $flatten := ARRAY_JOIN($diffColumns,", ");

RETURN $flatten

BulkCreateRecords.FieldValuesFormula:
LET $data 	:= [Import Data];
LET $firstRow := ARRAY_INDEX($data, 1);
LET $rest     := ARRAY_SKIP($data, 1);

LET $groupedData := 
	ARRAY_TO_HASH_GROUPED(
		$rest, 
		$(k, key) ARRAY_FIRST($key),
		$(v, value) $value 
	);	

LET $hashedData :=
	ARRAY_SELECT(
			HASH_KEYS($groupedData), $(i, item) 
			LET $values := ARRAY_TRANSPOSE(HASH_GET($groupedData, $item));
			LET $content := INDEXES_TO_KEYS($values, $firstRow);
		 	RETURN 
	  	 		HASH(
		 		  	"content", $content, 
		 		  	"match", HASH("RecordID", $item)
	  	 		)
			); 	

RETURN $hashedData
